import { BrowserRouter as Router } from "react-router-dom";

import Navbar from "../components/Navbar";
import Footer from "../components/Footer";

const Layout = ({ children }) => {
  return (
    <Router>
      <Navbar />
      <main>{children}</main>
      <Footer />
    </Router>
  );
};

export default Layout;
